import React, { Component } from 'react'
import Navbarmenu from "./Navbarmenu"
import Footer from "./footer"
export default class RentCar extends Component {
    render() {
        return (
            <div className="RentCar">
                <div className="container-fluid bg-dark">
                    <Navbarmenu />
                    <Footer />
                </div>
            </div>
        )
    }
}
